import React from "react";

const Header = () => {
    return (
        <div className="header-conteiner">
            <li>
            <Link to="/">Dogs</Link>
            </li>
            <li>
            <Link to="/cats">Cats</Link>
            </li>
            <li>
            <Link to="/sheeps">Sheeps</Link>
            </li>
        </div>
    );
};

export default Header;
